import React, { Component } from "react";
import axios from "axios";

export class App extends Component {
  constructor() {
    super();
    this.state = {
      data: ""
    };
  }

  componentDidMount() {
    axios.get(`https://jsonplaceholder.typicode.com/users`).then(res => {
      const persons = res.data;
      this.setState({ data: persons });
    });
  }
  render() {
    return <div></div>;
  }
}

export default App;
